/**
 * @param {string} word
 * @return {number}
 */
var numDifferentIntegers = function (word) {
  const newWord = word.replace(/[a-z]+/g, " ").trim();
  if (!newWord) return 0;
  const numSet = new Set();
  newWord.split(" ").forEach((numStr) => {
    console.log("numStr", numStr);
    numSet.add(numStr.replace(/^[0]+/g, ""));
  });
  return numSet.size;
};

console.log(
  numDifferentIntegers(
    ""
  )
);
